import React from "react";
import HomePage from "./ProfessorComponents/Page1/homepage.js";

function MergeComponents(props) {
  return (
    <div>
      {props.authority === "ROLE_FACULTY" ? (
        <HomePage />
      ) : props.authority === "ROLE_STUDENT" ? (
        <HomePage />
      ) : props.authority === "ROLE_ADMIN" ? (
        <HomePage />
      ) : (
        <HomePage />
      )}
    </div>
  );
}

export default MergeComponents;
